import React from 'react';
import CarForm from './component'

const CarList = ({ cars, deleteCar }) => {
  console.log('Cars in CarList:', cars);

  return (
    <div className="main-menu">
      <h2>Buy Car</h2>
      <div className="item-wrapper">
        {cars.length === 0 ? (
          <p>No cars available. Please add some cars.</p>
        ) : (
          cars.map((car, index) => (
            <div key={index} className="item-card">
              <img className="item-img" src={car.image} alt={car.name} />
              <div className="item-details">
                <div className="item-name">
                  <h4>{car.name}</h4>
                  <p className="item-description">{car.description}</p>
                  <p className="price">R{car.price}</p>
                  <button onClick={() => deleteCar(index)}>Delete</button> {/* Button to delete car */}
                </div>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default CarList;
